let innerHtml = "<p style=\"line-height: 2;\"><span style=\"font-size: 16px;\">2017年底，机器视觉初创企业精锐视觉智能科技（深圳）有限公司完成数千万Pre-A轮融资，由梅花天使、同创伟业、宏石铄金三方共同投资，白泽资本（原以太资本）担任独家财务顾问。</span></p><p style=\"line-height: 2;\"><span style=\"font-size: 16px;\">精锐视觉是国内最早将AI应用于工业视觉领域的高新科技企业之一，作为国内领先的计算机视觉和深度学习技术的研发者，专注于将人工智能技术广泛应用于工业视觉领域，赋能AI于多个制造行业。拥有多项高壁垒技术，例如：基于深度学习的外观缺陷视觉检测技术、产品几何参数的亚像素精确测量技术、双目视觉导航系统等十余项专利技术，目前这些专利技术已经迅速在手机、包装、PCB及汽车制造等行业形成了成熟的解决方案，并与众多知名的合作伙伴及大客户企业建立了长期稳定的合作关系，例如：华为、欧菲科技、歌尔声学、东亚工业、培力药业等等。</span></p><p style=\"line-height: 2;\"><img src=\"data:image/png;base64,\" alt=\"oYYBAF2EoxGAN0fmAADT7ldTXcU219 2@2x.png\" data-href=\"\" style=\"width: 100%;\">精锐视觉总部位于深圳，并在上海设立了研发中心，在青岛、南昌、东莞等地设有分公司，核心团队由来自中国科学院及上海交通大学的多名技术专家组成，同时团队具备强大的业务能力，业绩发展迅速。</p><p style=\"line-height: 2;\">创始人孔庆杰博士表示：精锐视觉契合了国家大力推动人工智能助力制造业的大趋势，在目前传统制造业普遍依赖人工进行产品质量检测的大环境下，基于人工智能的机器视觉技术应用于制造行业的市场前景非常广阔；利用本次融资，精锐视觉将重点推进目前已经标准化的几款智能视觉检测设备的订单生产和功能升级，进一步扩大销售队伍，加强品牌和产品的宣传力度，以及向更多的制造业行业进行技术与市场开拓。</p><p style=\"line-height: 2;\">梅花天使两位合伙人是见面当下即果断决定投资的，合伙人之一张筱燕表示：我非常看好孔庆杰团队在这个方面的技术积累和工程化能力，也相信精锐视觉在工业视觉领域一定会成为卓越的公司！</p><p style=\"line-height: 2;\">同创伟业董事长郑伟鹤表示：精锐视觉作为国内工业视觉领域的代表公司之一，已经在多个专业应用领域崭露头角，我们相信公司在孔庆杰博士团队的带领下，会取得更好的发展！</p><p style=\"line-height: 2;\">据悉，精锐视觉目前已开始下一轮次融资。</p><p style=\"line-height: 2;\">以太创服CEO周子敬表示：一直关注人工智能技术在各个领域落地的新机会，很荣幸能帮助精锐视觉，精锐视觉契合了国家大力推动人工智能助力制造业的大趋势，有很大市场空间，精锐视觉是国内最早切入这个领域的公司之一，并且目前在国内鲜有同类公司具备同等水平的技术实力、发展速度，以及在多个细分行业的市场占有率。我们相信精锐视觉在资本的助力下，将会向着成为这个行业独角兽的道路上飞速前进。</p><p style=\"line-height: 2;\">白泽资本：由原以太资本核心成员组建而成，现有团队100人,专注为高成长创新企业提供从商业故事梳理到资金入账的一站式、全流程融资服务。白泽团队至今已为超过900个项目完成融资,融资总额逾120亿人民币。白泽资本负责人彭然说：「白泽善语，通万物，是代表祥瑞的神兽，我们希望能够为客户带来福音。」&nbsp;品牌升级后，白泽团队将依托以太的全方位支持，为每一个项目服务过程中投入更多资源与精力，切实提升服务品质与用户体验。</p><p style=\"line-height: 2;\">本文来自行业资讯，创业家系授权发布，略经编辑修改，版权归作者所有，内容仅代表作者独立观点。</p>"

